import React, { useState, useEffect } from 'react';
import { useParams, Link } from 'react-router-dom';
import api from '../../utils/api';
import { toast } from 'react-toastify';
import { useAuth } from '../../contexts/AuthContext';

const TeamDashboard = () => {
  const { teamId } = useParams();
  const { user } = useAuth();
  
  const [team, setTeam] = useState(null);
  const [game, setGame] = useState(null);
  const [submissions, setSubmissions] = useState([]);
  const [scoreboard, setScoreboard] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  
  // Fetch team data and related info
  useEffect(() => {
    const fetchTeamData = async () => {
      try {
        setIsLoading(true);
        
        // Get team details
        const teamResponse = await api.teams.getById(teamId);
        setTeam(teamResponse.data);
        
        // Get game details
        const gameResponse = await api.games.getById(teamResponse.data.game);
        setGame(gameResponse.data);
        
        // Get team submissions
        const submissionsResponse = await api.submissions.getByTeam(teamId);
        setSubmissions(submissionsResponse.data);
        
        // Get scoreboard for the game
        const scoreboardResponse = await api.get(`/api/games/${gameResponse.data._id}/scoreboard`);
        setScoreboard(scoreboardResponse.data);
      } catch (error) {
        console.error('Error fetching team data:', error);
        toast.error('Der opstod en fejl ved hentning af holddata');
      } finally {
        setIsLoading(false);
      }
    };
    
    fetchTeamData();
  }, [teamId]);
  
  if (isLoading) {
    return (
      <div className="flex justify-center items-center h-64">
        <p className="text-gray-500">Indlæser holdoplysninger...</p>
      </div>
    );
  }
  
  if (!team || !game) {
    return (
      <div className="text-center py-8">
        <h2 className="text-2xl font-bold text-red-600 mb-4">Hold ikke fundet</h2>
        <p className="text-gray-600 mb-6">Det valgte hold findes ikke eller du har ikke adgang til det.</p>
        <Link to="/join-game" className="bg-blue-800 hover:bg-blue-900 text-white font-bold py-2 px-4 rounded">
          Tilbage til Find spil
        </Link>
      </div>
    );
  }
  
  // Find team position in scoreboard
  const teamPosition = scoreboard.findIndex(item => item._id === teamId) + 1;
  
  // Calculate task completion stats
  const completedTasks = submissions.filter(s => s.isEvaluated).length;
  const pendingTasks = submissions.filter(s => !s.isEvaluated).length;
  
  return (
    <div className="max-w-6xl mx-auto">
      <div className="flex flex-col md:flex-row justify-between items-start mb-8">
        <div>
          <h1 className="text-3xl font-bold text-blue-900">{team.name}</h1>
          <p className="text-gray-600 text-lg">Spil: {game.title}</p>
        </div>
        
        <div className="bg-blue-800 text-white px-6 py-3 rounded-lg flex flex-col items-center mt-4 md:mt-0">
          <span className="text-sm">Holdets point</span>
          <span className="text-3xl font-bold">{team.points}</span>
          <span className="text-xs mt-1">Placering: {teamPosition} af {scoreboard.length}</span>
        </div>
      </div>
      
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-8">
        {/* Team members card */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-gray-800 mb-4">Holdmedlemmer</h2>
          
          <ul className="space-y-2">
            {team.members.map(member => (
              <li key={member._id} className="flex items-center">
                <div className="bg-blue-100 text-blue-800 rounded-full h-8 w-8 flex items-center justify-center mr-3">
                  {member.username.charAt(0).toUpperCase()}
                </div>
                <span className="text-gray-700">{member.username}</span>
                {member._id === user._id && (
                  <span className="ml-2 text-xs bg-gray-200 px-2 py-1 rounded">Dig</span>
                )}
              </li>
            ))}
          </ul>
        </div>
        
        {/* Tasks progress card */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-gray-800 mb-4">Opgavefremdrift</h2>
          
          <div className="space-y-4">
            <div>
              <div className="flex justify-between mb-1">
                <span className="text-sm text-gray-600">Afsluttede opgaver</span>
                <span className="text-sm font-medium text-blue-800">{completedTasks}</span>
              </div>
              <div className="w-full bg-gray-200 rounded-full h-2.5">
                <div 
                  className="bg-blue-800 h-2.5 rounded-full" 
                  style={{ width: `${completedTasks > 0 ? (completedTasks / (completedTasks + pendingTasks)) * 100 : 0}%` }}
                ></div>
              </div>
            </div>
            
            <div>
              <div className="flex justify-between mb-1">
                <span className="text-sm text-gray-600">Ventende bedømmelse</span>
                <span className="text-sm font-medium text-orange-500">{pendingTasks}</span>
              </div>
            </div>
            
            <div className="pt-4 mt-4 border-t">
              <Link 
                to={`/tasks/${game._id}`}
                className="inline-block bg-green-600 hover:bg-green-700 text-white py-2 px-4 rounded-md w-full text-center"
              >
                Find nye opgaver
              </Link>
            </div>
          </div>
        </div>
        
        {/* Game info card */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-gray-800 mb-4">Spiloplysninger</h2>
          
          <div className="space-y-3">
            <div>
              <span className="text-sm text-gray-500">Spiltitel</span>
              <p className="text-gray-800">{game.title}</p>
            </div>
            
            <div>
              <span className="text-sm text-gray-500">Beskrivelse</span>
              <p className="text-gray-800">{game.description}</p>
            </div>
            
            <div>
              <span className="text-sm text-gray-500">Adgangskode</span>
              <p className="text-gray-800 font-mono">{game.accessCode}</p>
            </div>
            
            {game.endTime && (
              <div>
                <span className="text-sm text-gray-500">Slutter</span>
                <p className="text-gray-800">
                  {new Date(game.endTime).toLocaleDateString('da-DK', {
                    day: 'numeric',
                    month: 'long',
                    year: 'numeric',
                    hour: '2-digit',
                    minute: '2-digit'
                  })}
                </p>
              </div>
            )}
            
            <div className="pt-4 mt-4 border-t">
              <Link 
                to={`/reflection/${game._id}`}
                className="inline-block bg-blue-600 hover:bg-blue-700 text-white py-2 px-4 rounded-md w-full text-center"
              >
                Refleksion & evaluering
              </Link>
            </div>
          </div>
        </div>
      </div>
      
      {/* Scoreboard section */}
      <div className="bg-white p-6 rounded-lg shadow-md mb-8">
        <h2 className="text-xl font-semibold text-gray-800 mb-4">Rangliste</h2>
        
        <div className="overflow-x-auto">
          <table className="min-w-full">
            <thead className="bg-gray-50 border-b">
              <tr>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Placering
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Hold
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Point
                </th>
                <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                  Opgaver løst
                </th>
              </tr>
            </thead>
            <tbody className="divide-y divide-gray-200">
              {scoreboard.map((scoreTeam, index) => (
                <tr 
                  key={scoreTeam._id} 
                  className={`${scoreTeam._id === teamId ? 'bg-blue-50' : ''}`}
                >
                  <td className="px-6 py-4 whitespace-nowrap text-sm">
                    <div className="flex items-center">
                      <span className={`
                        ${index === 0 ? 'bg-yellow-100 text-yellow-800' : ''}
                        ${index === 1 ? 'bg-gray-200 text-gray-800' : ''}
                        ${index === 2 ? 'bg-amber-100 text-amber-800' : ''}
                        ${index > 2 ? 'bg-gray-100 text-gray-800' : ''}
                        h-6 w-6 rounded-full flex items-center justify-center text-xs font-medium
                      `}>
                        {index + 1}
                      </span>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">
                    {scoreTeam.name}
                    {scoreTeam._id === teamId && (
                      <span className="ml-2 text-xs bg-blue-100 text-blue-800 px-2 py-1 rounded">
                        Dit hold
                      </span>
                    )}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm">
                    <span className="font-medium text-gray-900">{scoreTeam.points}</span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                    {scoreTeam.completedTasks || 0}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
      
      {/* Recent submissions */}
      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-semibold text-gray-800 mb-4">Seneste besvarelser</h2>
        
        {submissions.length > 0 ? (
          <div className="space-y-4">
            {submissions.slice(0, 5).map(submission => (
              <div key={submission._id} className="border-b pb-4 last:border-0">
                <div className="flex justify-between">
                  <h3 className="font-medium">{submission.task.title}</h3>
                  <div>
                    {submission.isEvaluated ? (
                      <span className="bg-green-100 text-green-800 text-xs px-2 py-1 rounded-full">
                        {submission.pointsEarned >= 0 ? `+${submission.pointsEarned}` : submission.pointsEarned} point
                      </span>
                    ) : (
                      <span className="bg-yellow-100 text-yellow-800 text-xs px-2 py-1 rounded-full">
                        Afventer bedømmelse
                      </span>
                    )}
                  </div>
                </div>
                <p className="text-sm text-gray-600 mt-1">
                  {submission.task.type === 'multiple_choice' ? 'Multiple choice' : ''}
                  {submission.task.type === 'text' ? 'Tekstbesvarelse' : ''}
                  {submission.task.type === 'video' ? 'Videobesvarelse' : ''}
                </p>
                <p className="text-xs text-gray-500 mt-2">
                  Indsendt {new Date(submission.submittedAt).toLocaleDateString('da-DK', {
                    day: 'numeric',
                    month: 'short',
                    hour: '2-digit',
                    minute: '2-digit'
                  })}
                </p>
              </div>
            ))}
          </div>
        ) : (
          <div className="text-center py-6">
            <p className="text-gray-500">Ingen besvarelser endnu.</p>
            <Link 
              to={`/tasks/${game._id}`}
              className="inline-block mt-4 text-blue-600 hover:text-blue-800"
            >
              Find og løs opgaver
            </Link>
          </div>
        )}
      </div>
    </div>
  );
};

export default TeamDashboard;
